Polkasvap SORA icması tərəfindən qorunur. Polkasvap funksiyasından istifadə etməzdən əvvəl, Polkasvapı istifadə etməzdən əvvəl, Polkasvap Memorandumu və Xidmət Şərtlərini və Məxfilik Siyasətini ətraflı izah edən Polkasvap Çox Soruşulan Sualları (FAQ) nəzərdən keçirdin. Bu sənədlər etibarlı və pozitiv istifadəçi təcrübəsi üçün çox vacibdir. Polkasvap istifadə etməklə, bu sənədləri oxuduğunuzu və başa düşdüyünüzü qəbul edirsiniz. 

 Həmçinin aşağıdakıları da qəbul edirsiniz: 

 1) qanuni yurisdiksiyanızda xüsusi olaraq Polkasvap istifadə etməyiniz üçün tətbiq oluna biləcək bütün qanunlara riayət etmək üçün tək məsuliyyət daşımağınız;
 2) Polkasvap -ın cari versiyasının alfa versiyası olduğunu başa düşməyiniz: tam sınaqdan keçirilməmişdir və bəzi funksiyalar nəzərdə tutulduğu kimi yerinə yetirə bilinməz;
 3) Polkaswap istifadə etməklə əlaqəli riskləri başa düşməyiniz və könüllü olaraq qəbul etməyiniz, tokenləri itirmək də daxil olmaqla, ancaq bununla məhdudlaşmır. Bir daha diqqətinizə çatdırırıq ki, FAQ, Polkasvap Memorandumu və Xidmət Şərtləri və Məxfilik Siyasətini oxumadan davam etməyin!

